  [],\n\t\"num_tags\": 0,\n\t\"name\": \"meteorological-oceanographic-wave-spectra-and-other-data-from-fixed-platforms-from-the-north-at9568e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Meteorological, oceanographic, wave spectra,
  and other data were collected from FIXED PLATFORMS. Data were collected by the National
  Data Buoy Center (NDBC) from 01 September 1985 to 15 September 1985. Data were processed
  by NODC to the standard F291 - Meteorology, Oceanography, and Wave Spectra format.
  Full format descriptions are available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f291.html.
  Digital data are not available at this time.nnThe F291 format is used to report
  meteorological, oceanographic, and wave spectra data from NDBC moored buoys and
  fixed land stations. The format contains thirteen data record types to: 1) Identify
  the buoy position and other descriptive information; 2) report the meteorological
  measurements; 3) report wave energy spectra and wave direction; 4) report subsurface
  physical, biological and chemical oceanographic measurements; and 5) report detailed
  information on continuously measured wind speed and direction. Each record is 120
  characters in length, sorted by station and record type. Record type is omitted
  where data defined in that type and not measured. The first nine columns for all
  records are to be used for file type (columns 1-3) and file identifier (columns
  4-9). The file identifier, assigned by the originator, is a unique originator id
  for each data submission. After submission, the NODC reassigns to this field a unique
  and NODC identifier for internal use.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
